<html>
<head>
<meta name="viewport" content="initial-scale=1.0, user-scalable=no" />
<meta http-equiv="content-type" content="text/html; charset=UTF-8"/>
<title>Google Maps - pygmaps </title>
<script type="text/javascript" src="https://maps.googleapis.com/maps/api/js?libraries=visualization&sensor=true_or_false"></script>
<script type="text/javascript">
	function initialize() {
		var centerlatlng = new google.maps.LatLng(33.448377, -112.074037);
		var myOptions = {
			zoom: 162,
			center: centerlatlng,
			mapTypeId: google.maps.MapTypeId.ROADMAP
		};
		var map = new google.maps.Map(document.getElementById("map_canvas"), myOptions);

var coords = [
new google.maps.LatLng(33.449832, -112.074037),
new google.maps.LatLng(33.449810, -112.074340),
new google.maps.LatLng(33.449744, -112.074634),
new google.maps.LatLng(33.449637, -112.074909),
new google.maps.LatLng(33.449492, -112.075158),
new google.maps.LatLng(33.449312, -112.075373),
new google.maps.LatLng(33.449105, -112.075548),
new google.maps.LatLng(33.448875, -112.075676),
new google.maps.LatLng(33.448630, -112.075755),
new google.maps.LatLng(33.448377, -112.075781),
new google.maps.LatLng(33.448124, -112.075755),
new google.maps.LatLng(33.447879, -112.075676),
new google.maps.LatLng(33.447650, -112.075548),
new google.maps.LatLng(33.447442, -112.075373),
new google.maps.LatLng(33.447262, -112.075158),
new google.maps.LatLng(33.447117, -112.074909),
new google.maps.LatLng(33.447010, -112.074634),
new google.maps.LatLng(33.446944, -112.074340),
new google.maps.LatLng(33.446922, -112.074037),
new google.maps.LatLng(33.446944, -112.073734),
new google.maps.LatLng(33.447010, -112.073441),
new google.maps.LatLng(33.447117, -112.073165),
new google.maps.LatLng(33.447262, -112.072916),
new google.maps.LatLng(33.447442, -112.072701),
new google.maps.LatLng(33.447650, -112.072527),
new google.maps.LatLng(33.447879, -112.072399),
new google.maps.LatLng(33.448124, -112.072320),
new google.maps.LatLng(33.448377, -112.072293),
new google.maps.LatLng(33.448630, -112.072320),
new google.maps.LatLng(33.448875, -112.072399),
new google.maps.LatLng(33.449105, -112.072527),
new google.maps.LatLng(33.449312, -112.072701),
new google.maps.LatLng(33.449492, -112.072916),
new google.maps.LatLng(33.449637, -112.073165),
new google.maps.LatLng(33.449744, -112.073441),
new google.maps.LatLng(33.449810, -112.073734),
];

var polygon = new google.maps.Polygon({
clickable: false,
geodesic: true,
fillColor: "#000000",
fillOpacity: 0.500000,
paths: coords,
strokeColor: "#000000",
strokeOpacity: 1.000000,
strokeWeight: 1
});

polygon.setMap(map);


	}
</script>
</head>
<body style="margin:0px; padding:0px;" onload="initialize()">
	<div id="map_canvas" style="width: 100%; height: 100%;"></div>
</body>
</html>
